import astronomerImg from '../images/memory-game-images/astronomer.png';
import banditImg from '../images/memory-game-images/bandit.png';
import confessorImg from '../images/memory-game-images/confessor.png';
import heroImg from '../images/memory-game-images/hero.png';
import prisonerImg from '../images/memory-game-images/prisoner.png';
import prophetImg from '../images/memory-game-images/prophet.png';
import samuraiImg from '../images/memory-game-images/samurai.png';
import vagabondImg from '../images/memory-game-images/vagabond.png';
import warriorImg from '../images/memory-game-images/warrior.png';
import wretchImg from '../images/memory-game-images/wretch.png';

const characters= [
    { cardImg: astronomerImg, cardTitle: "Astronomer" },
    { cardImg: banditImg, cardTitle: "Bandit" },
    { cardImg: confessorImg, cardTitle: "Confessor" },
    { cardImg: heroImg, cardTitle: "Hero" },
    { cardImg: prisonerImg, cardTitle: "Prisoner" },
    { cardImg: prophetImg, cardTitle: "Prophet" },
    { cardImg: samuraiImg, cardTitle: "Samurai" },
    { cardImg: vagabondImg, cardTitle: "Vagabond" },
    { cardImg: warriorImg, cardTitle: "Warrior" },
    { cardImg: wretchImg, cardTitle: "Wretch" }
  ];

  export default characters;
